(26, , 'Castrol Edge 5W30 Titanium FST LL 5L', 'castrol', 'ref. 1200', 'Aceite sintÃ©tico', '5', '5w30', '<strong>No vÃ¡lido para BMW </strong> (se puede utilizar en el resto de marcas). El aceite Castrol EDGE 5W-30 LL incorpora la tecnologÃ­a mÃ¡s novedosa de Castrol, indicada para motores de alto rendimiento. Es el lubricante ideal cuando se requiere el mayor nivel de protecciï¿½n. Aceite Long Life, ideal para intervalos de servicio extendidos. Si su coche es un BMW use Castrol Edge titanium FST 5W30 C3.', 39.99, 0, 'Ventajas de este aceite\r\nCastrol EDGE 5W-30 LL le da la confianza para exigir el mï¿½ximo rendimiento de su moderno motor con la ultima tecnologï¿½a de hoy en dia, motores de alta ingenierï¿½a que operan con tolerancias mï¿½s estrictas, que requieren un alto nivel de protecciï¿½n y aceites de baja viscosidad.\r\n\r\nEspecificaciones\r\nACEA C3\r\nMB-Approval 229.31/ 229.51\r\nPorsche C30\r\nVW 504 00/ 507.00\r\nAceite indicado como long life por el fabricante.\r\n\r\nRendimiento superior a las especificaciones de las siguientes marcas:\r\n\r\nAUDI\r\nHONDA\r\nSEAT\r\nSMART\r\nVOLKSWAGEN\r\nMERCEDES-BENZ\r\nMITSUBISHI\r\nï¿½KODA\r\nSUBARU', 'Especificaciones aqui', '0', 'Ficha Técnica', 'castrol/castrol-edge-titanium-fst-5w30-ll-5-litros/Castrol Edge LL Titanium FST', 'Ficha de Seguridad', 'castrol/castrol-edge-titanium-fst-5w30-ll-5-litros/Ficha de seguridad Castrol Edge 5w-30 ll');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(28, , 'Total Quartz Ineo ECS 5W30 5L', 'total', '', 'Aceite sintético', '5', '5w30', 'Lubricante de nueva generación y tecnología de síntesis “Low Saps”, concebido para motores Peugeot y Citröen. Su alto nivel de tecnología permite ahorrar carburante y mejorar el rendimiento de los sistemas antipolución, especialmente los filtros de partículas FAP. Aconsejado para motores diésel y la mayor parte de motores de gasolina.', 23.99, 0, '<strong>Especificaciones</strong><br><br>\r\nACEA C2\r\nPSA PEUGEOT CITROËN: B71 2290', '', '8414794047905', 'Ficha Técnica', 'total/total-quartz-ineo-ecs-5w30-5l/Ficha Tecnica Total_Quartz_Ineo_ECS_5w30', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(29, , 'Opel Dexos2 5W30 5L', 'opel', '', 'Aceite sintético', '5', '5w30', 'Aceite sintético, para motores de gasolina y diesel, fabricado con una mezcla de aceites base de alto rendimiento y modernos aditivos, formulados para ser completamente compatibles con los más recientes filtros de partículas diesel (DPF) y convertidores catalíticos para motores de Gasolina (CAT).', 23.99, 0, 'Exclusiva combinación de aceites base sintetizados y la más moderna tecnología de aditivos, representa lo mejor en calidad de aceites de motor, combinando ahorro de combustible, drenajes ampliados y emisiones reducidas, para los motores diesel y gasolina de última generación en vehículos de pasajeros.\r\n<br><br>\r\nOPEL Dexos2 5W-30 es un aceite de motor sintético de primera calidad. Está formulado tomando como base aceite sintetizado y la más exclusiva tecnología de aditivos. Opel Dexos2 5w30 combina el ahorro de combustible, con los mantenimientos ampliados y emisiones de CO2 reducidas.\r\n<br><br>\r\nEl aceite de motor Opel Dexos2 está fabricado para ser utilizado en motores diesel y gasolina de última generación en vehículos ligeros. Con la utilización del aceite de motor Opel Dexos2 5w30 obtenemos beneficios como una excelente protección del desgaste mecánico del motor incluso en altas temperaturas de trabajo de este. Además retrasamos la oxidación del aceite, manteniendo el rendimiento óptimo durante un mayor tiempo y reducimos el consumo de combustible.\r\n<br><br>\r\nCumple con los estándares de SAE 5W-30, ACEA C3 API SM/CF y con las homologaciones y especificaciones GM Longlife Dexos2 que sustituye las especificaciones GM-LL-A-025 y GM-LL-B-025 para intervalos de servicio ampliados. Para coches equipados con ECO-Service System y vehículos con filtros de partículas FAP que cumplan las siguientes especificaciones y homologaciones de los constructores \r\n<br><br>\r\n\r\n<strong>Especificaciones</strong><br>\r\nAPI SM/CF<br>\r\nACEA C3 <br>\r\nGM-LL-A-025 / GM-LL-B-025<br>\r\nBMW LL-04<br>\r\nVW 502.00 / 505.00 / 505.01<br>\r\nMB 229.51<br>', '', '4011977989324', 'Ficha Técnica', 'opel/opel-5w30-05w30/OPEL 5W30', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(30, , 'Ford Formula F 5W30 5L', 'ford', '', 'Aceite sintético', '5', '5w30', 'Aceite de motor sintético especificamente desarrollado para Ford, de alto rendimiento que mejora el funcionamiento del motor y reduce el consumo de combustible además de respetar el medio ambiente.', 23.99, 0, '<strong>Aplicaciones del aceite:</strong><br>\r\nAceite especialmente desarrollado para FORD y para todos los constructores (ROVER, JAGUAR, RENAULT gasolina, PSA) que preconizan aceites de baja viscosidad.\r\nRecomendable para motores donde que pidan aceite “Fuel Economy” según las normas ACEA A5/A1/B1. Es compatible con los sistemas de catalizador.<br>\r\n<strong>Especificaciones:</strong><br>\r\nACEA A5/A1/B1<br>\r\nAPI SJ – ILSAC GF-2<br>\r\nCumple la normativa Ford M2C913 A/B/C', '', '4008177968846', 'Ficha de Seguridad', 'ford/ford-formula-f5w30/Ficha de seguridad Ford Formula F 5W30', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(31, , 'ELF Evolution 900 SXR 5W30 5L', 'elf', '', 'Aceite sintético', '5', '5w30', 'Se trata de un aceite de tecnología de síntesis ELF. Está orientado a la lubricación de motores diésel y gasolina en turismos. Se recomienda para diferentes tipos de recorrido y conducción, ya que ofrece una gran estabilidad térmica y garantiza además una baja degradación, alargando así la vida útil del motor. Garrafa de 5 litros.', 22.99, 0, '<h3><strong>Ventajas del aceite</strong></h3>\r\n<ul>\r\n<li>Econom&iacute;a de carburante.&nbsp;Disminuye el consumo y las emisiones contaminantes</li>\r\n<li>Prestaciones de producto alto de gama.&nbsp;Excelente protecci&oacute;n de los motores en particular contra el desgaste en la zona de la distribuci&oacute;n.</li>\r\n<li>Prolonga la vida del motor.&nbsp;Excepcional estabilidad t&eacute;rmica y frente a la oxidaci&oacute;n, disminuyendo la degradaci&oacute;n del aceite incluso en las utilizaciones m&aacute;s severas.</li>\r\n</ul>\r\n<h3><strong><br />Especificaciones</strong></h3>\r\n<ul>\r\n<li>ACEA : A5/B5</li>\r\n<li>API : SL/CF</li>\r\n<li>RENAULT RN0700: gasolina (excepto los motores 2.0 16V Renault Sport, 2.0 T Renault Sport)</li>\r\n</ul>\r\n<h3><strong><br />Utilizaci&oacute;n</strong></h3>\r\n<ul>\r\n<li>Todos los motores gasolina y diesel, en particular de las tecnolog&iacute;as m&aacute;s recientes.&nbsp;Recomendado para todos los motores de turismos y furgonetas de gasolina (multiv&aacute;lvulas, turbos, equipados o no con catalizadores) y diesel turboalimentados, o no, de turismos y furgonetas.</li>\r\n<li>Recorridos severos. Todo el a&ntilde;o.&nbsp;Recomendado para todo tipo de recorrido (ciudad, carretera o autopista) y particularmente para condiciones severas de uso.</li>\r\n<li>Conducci&oacute;n deportiva.&nbsp;Todo tipo de uso, incluso las conducciones a alto r&eacute;gimen y deportivas.</li>\r\n</ul>', '', '8414794048803', 'Ficha Técnica', 'elf/elf-evolution-900-sxr-5w30-e5w30/Ficha Tecnica Elf_Evolution_900_SXR_5w30', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(32, , 'LIQUI MOLY TOP TEC 4200 5W30 5L ', 'liqui', '', 'Aceite sintético', '5', '5w30', 'Aceite sintético de baja fricción interna para cualquier vehículo gasolina y diésel incluidos los diésel que tienen filtro de partículas según normas Euro y para vehículos con intervalos de mantenimiento largos.', 47.66, 0, '<p>ESPECIFICACIONES:</p>\r\n<p>ACEA C3 API SN BMW Longlife-04 MB-Freigabe 229.31 MB-Freigabe 229.51 Porsche C30 VW 504 00 VW 507 00</p>\r\n<p>&nbsp;</p>\r\n<p>LIQUI MOLY TAMBI&Eacute;N RECOMIENDA ESTE PRODUCTO PARA LOS VEH&Iacute;CULOS O GRUPOS QUE DEBEN CUMPLIR CON LOS N.&deg; DE PIEZAS DE REPUESTO ORIGINALES O LAS ESPECIFICACIONES QUE SE INDIQUEN A CONTINUACI&Oacute;N:</p>\r\n<p>ACEA A3 ACEA A5 ACEA B4 ACEA B5 ACEA C2 BMW Longlife-01 BMW Longlife-01 FE Fiat 9.55535-S1 Fiat 9.55535-S3 Peugeot Citroen (PSA) B71 2290 VW 500 00 VW 501 01 VW 502 00 VW 503 00 VW 503 01 VW 505 00 VW 505 01 VW 506 00 VW 506 01 (Ausnahme R5 und V10 TDI-Motoren vor 6/2006)</p>', '', '4100420089732', '', '', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(33, , 'Mobil 1 5W30 ESP Fórmula 5L', 'mobil', '', 'Aceite sintético', '5', '5w30', 'El aceite sintético Mobil 1 5W30 ESP Fórmula 5L protege del desgaste y limpia nuestro motor. Bajo contenido en cenizas que ayuda a la conservación idónea del filtro de partículas. Al tener un bajo contenido en azufre y fósforo reducimos la contaminación. Ideal para los vehículos diésel.<br><br>\r\n\r\nPrestaciones excelentes a bajas temperaturas y rápido arranque en condiciones climatológicas frías.', 41.00, 0, '<p><strong>Especificaciones:</strong></p>\r\n<ul>\r\n<li>ACEA C2/C3, A3/B3/B4</li>\r\n<li>ACEA (cumple los requisitos de las pruebas para A5/B5 motores)</li>\r\n<li>API (cumple los requisitos de las pruebas para motores) SL/SM</li>\r\n<li>API CF</li>\r\n<li>JASO DL-1-08</li>\r\n</ul>\r\n<p><strong>Aprobaciones de constructores</strong><strong>:</strong></p>\r\n<ul>\r\n<li>BMW Longlife 04</li>\r\n<li>MB-Approval 229.31/229.51</li>\r\n<li>Volkswagen (Gasoline / Diesel) 504.00 / 507.00</li>\r\n<li>Porsche C30</li>\r\n<li>Chrysler MS-11106</li>\r\n<li>Peugeot Citroen Autom&oacute;viles B71-2290 / B71 2297</li>\r\n<li>GM Dexos2</li>\r\n</ul>', '', '5425037864428', 'Ficha de Seguridad', 'mobil/mobil-1-5w30-esp-formula-5-litros/Ficha de Seguridad Mobil 1 5W30 ESP Formula', 'Ficha Técnica', 'mobil/mobil-1-5w30-esp-formula-5-litros/GLXXMobil-1-ESP-Formula-5W30');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(34, , 'Motul 8100 X-Clean+ 5W30 5L', 'motul', '', 'Aceite sintético', '5', '5w30', 'Aceite de altas prestaciones, con un 100% de base sintética. Se recomienda para motores tanto de gasolina como diésel que se ajusten a la norma anti-contaminante Euro IV o Euro V. Especialmente diseñado para vehículos de última generación del Grupo Mercedes, BMW, Porsche y Vag (Audi, VW, Seat, Skoda). Es compatible con filtros de partículas FAP y sistemas anti-contaminantes. Garrafa de 5 litros.', 33.99, 0, '<h3><strong>Especificaciones</strong></h3>\r\n<ul>\r\n<li>ACEA C3</li>\r\n<li>BMW Long Life-04</li>\r\n<li>MB-Approval 229.51</li>\r\n<li>Porsche C30</li>\r\n<li>VW 504 00 - 507 00</li>\r\n</ul>\r\n<p><br />Los motores que respondan a las normas anti-contaminante EURO IV y EURO V est&aacute;n equipados con sistemas descontaminantes muy sensibles. El azufre y el f&oacute;sforo inhiben el funcionamiento del catalizador provocando una p&eacute;rdida de rendimiento en los dispositivos, y las cenizas sulfatadas obstruyen el FAP (Filtro de Part&iacute;culas) provocando continuas regeneraciones, un envejecimiento acelerado del aceite, un consumo mayor de carburante y una reducci&oacute;n en las prestaciones del motor.<br /><br />La norma BMW Long Life-04 exige al lubricante que responda a condiciones severas para garantizar una longevidad del FAP de todos los motores BMW Diesel. Este cubre &iacute;ntegramente todos los motores BMW Gasolina y Diesel a partir de 2004. La norma BMW LL-04 cubre todas las normas anteriores del grupo BMW LL-98 y BMW LL-01.<br /><br />Atenci&oacute;n, la norma BMW LL-04 debe utilizarse en motores Gasolina &uacute;nicamente dentro de la Uni&oacute;n Europea, Suiza, Noruega y Liechtenstein: Referirse a la recomendaci&oacute;n de BMW (en otros pa&iacute;ses, BMW LL-01 es generalmente prescrito: MOTUL 8100 X-cess 5W-40).<br /><br />La norma MB 229.51 exige al lubricante niveles reducidos de cenizas sulfatadas, fosforo y azufre, con el fin de ser compatible con los sistemas anti-contaminantes. Este tipo de aceites permiten atender intervalos de mantenimiento flexibles determinados por el ordenador a bordo, gracias a sus incre&iacute;bles propiedades de resistencia al cizallamiento.<br /><br />La especificaci&oacute;n MB 229.51 es aplicada en todos los motores Gasolina, as&iacute; como en los motores Diesel con o sin FAP de MERCEDES.<br /><br />PORSCHE a introducido su norma Porsche C30 para lubricar perfectamente todos sus motores Diesel y todos los motores V6 Gasolina (Porsche Cayenne).<br /><br />Un aceite homologado &laquo; PORSCHE C30 &raquo; tal como el MOTUL 8100 X-clean+ 5W-30, satisface todas sus altas exigencias de prestaciones, en t&eacute;rminos de resistencia de la pel&iacute;cula lubricante.<br /><br />VOLKSWAGEN para sus normas VW 504 00 y VW 507 00 exige al lubricante una perfecta compatibilidad con sus sistemas de anti-contaminaci&oacute;n y los FAP, con el fin de garantizar una fiabilidad sin fallos en todos sus motores Gasolina y Diesel del grupo VW, AUDI, SEAT et SKODA.<br /><br />MOTUL 8100 X-clean+ 5W-30 responde a todas las exigencias de BMW, MERCEDES, PORSCHE y VW, a efectos de cada una de las normas para aceites de alto HTHS y Low SAPS, compatibles con los sistemas anti-contaminantes modernos.</p>', '', '3374650257723', 'Ficha de Seguridad', 'motul/motul-8100-x-clean-5w30-m5w30/FS Motul X-Cleanplus', 'Ficha Técnica', 'motul/motul-8100-x-clean-5w30-m5w30/Ficha Tecnica Motul 8100_X-clean__5W-30_(E)_0612');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(35, , 'Repsol Elite 5W30 Long Life 50700/50400 5L', 'repsol', '', 'Aceite sintético', '5', '5w30', 'El aceite Repsol Elite Long Life es un lubricante sintético para motores de gasolina y diésel de inyección directa o de sistemas de escape con filtros DPF del grupo Seat/Audi/VW/Skoda. Está destinado a satisfacer las especificaciones del VW 50700/504, para el que se exige un período de cambio de aceite muy prolongado. Reduce el consumo de combustible y lubricante. Garrafa de 5 litros.', 32.99, 0, '<h3><strong>Cualidades</strong></h3>\r\n<ul>\r\n<li>Los resultados obtenidos en el ensayo normalizado de VW con filtro de part&iacute;culas DPF aseguran la compatibilidad del aceite con este sistema de postratamiento de gases de escape, evitando el aumento de consumo de carburante y la p&eacute;rdida de prestaciones del motor ocasionadas por la acumulaci&oacute;n de cenizas en el filtro.</li>\r\n<li>Los ensayos internos realizados en motores gasolina y diesel Audi y VW garantizan las m&aacute;ximas prestaciones de este lubricante en toda la gama de veh&iacute;culos Euro 5 y anteriores de este fabricante.</li>\r\n<li>Bajo consumo de lubricante ya que est&aacute; formulado con bases sint&eacute;ticas de muy alta calidad.</li>\r\n<li>Producto de larga duraci&oacute;n, que puede prolongar notablemente los intervalos de cambio de aceite hasta 50.000 km seg&uacute;n la prescripci&oacute;n del fabricante del veh&iacute;culo</li>\r\n</ul>\r\n<p><br /><strong>Especificaciones<br /><br /></strong></p>\r\n<ul>\r\n<li>VW 507.00/504.00</li>\r\n</ul>\r\n<ul>\r\n<li>MB 229.51</li>\r\n<li>ACEA C3</li>\r\n</ul>\r\n<ul>\r\n<li>PORSCHE C30</li>\r\n</ul>', '', '8410921543050', 'Ficha Técnica', 'repsol/repsol-elite-long-life-5w30-50700-50400-r5w30/Ficha Tecnica Repsol RP_ELITE_LONG_LIFE_50700_50400_5W30_tcm13-55314', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(36, , 'Shell Helix Ultra ECT C3 5W30 5L', 'shell', '', 'Aceite sintético', '5', '5w30', 'Lubricante de motor totalmente sintético que garantiza la protección máxima para los sistemas de escape. Han sido fabricados usando la Tecnología PurePlus de Shell, la cual contribuye activamente a la limpieza del motor.', 37.90, 0, '<p><strong>Beneficios para el cliente</strong></p>\r\n<ul>\r\n<li>Protecci&oacute;n sin igual frente a los lodos</li>\r\n<li>Baja viscosidad y baja fricci&oacute;n para mejorar hasta un 1,7% el consumo de combustible</li>\r\n<li>Protege el sistema de escape contribuyendo a la limpieza del filtro de part&iacute;culas</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Especificaciones: ACEA C3; API SN; aprobaci&oacute;n MB 229.51, 229.31; BMW LL-04; GM dexos2TM; Chrysler MS-11106</p>', '', '5011987005655', '', '', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(37, , 'Toyota 5W30 PFE 5L', 'toyota', '', 'Aceite sintético', '5', '5w30', 'Aceite Original Toyota (TGMO), probado y desarrollado en exclusiva para ofrecer el mejor rendimiento de tu Toyota, sean cuales sean las condiciones de uso. El aceite 5w30 Premium Fuel Economy es ahora nuestro aceite recomendado en toda la gama, debido a las crecientes exigencias tanto técnicas como medio ambientales que demandan un aceite de la más alta calidad.', 39.95, 0, '<p>El aceite Toyota Genu&iacute;no 5W30 ACEA C2 Premium Fuel Economy (PFE) es un aceite de altas prestaciones, totalmente sint&eacute;tico, con bajos niveles de cenizas sulfatadas, f&oacute;sforo y azufre (low SAPS), dise&ntilde;ado espec&iacute;ficamente para mejorar el consumo y el rendimiento de veh&iacute;culos Toyota.&nbsp;</p>\r\n<p>Est&aacute; recomendado para los &uacute;ltimos motores di&eacute;sel y gasolina Toyota donde una calidad 5W30 est&eacute; indicada en el manual del usuario.</p>\r\n<p>Tambi&eacute;n se puede utilizar en modelos m&aacute;s antiguos de la marca, y ofrece un amplio rango de protecci&oacute;n durante todo el a&ntilde;o independientemente de las condiciones clim&aacute;ticas y de uso.</p>\r\n<p>El aceite de motor genuino Toyota est&aacute; formulado con un conjunto espec&iacute;fico de aditivos dise&ntilde;ado para motores Toyota, con los que se obtienen niveles de protecci&oacute;n superiores y unas caracter&iacute;sticas mejoradas en econom&iacute;a de consumo que merecen la etiqueta \"Premium Fuel Economy\".</p>\r\n<ul>\r\n<li>Protecci&oacute;n. Una fuerte y fina capa de lubricante protege las partes m&oacute;viles de su motor, disminuyendo la temperatura de funcionamiento.</li>\r\n<li>Potencia. Ayuda a sellar los espacios entre el pist&oacute;n y las camisas del cilindro, manteniendo los niveles de compresi&oacute;n adecuados para obtener el mayor rendimiento del motor.</li>\r\n<li>Econom&iacute;a. Proporciona un funcionamiento suave, reduciendo la energ&iacute;a necesaria para funcionar y por lo tanto, disminuyendo el consumo.</li>\r\n<li>Fiabilidad. Evita la formaci&oacute;n de dep&oacute;sitos, manteniendo su motor limpio.</li>\r\n<li>Longevidad. Neutraliza la formaci&oacute;n de &aacute;cidos y &oacute;xidos provenientes de la combusti&oacute;n.</li>\r\n<li>Versatilidad. Aceite adecuado para todo el a&ntilde;o y cualquier tipo de conducci&oacute;n.</li>\r\n</ul>\r\n<p><strong>Aplicaciones</strong></p>\r\n<p>El aceite de motor Toyota Genuine Motor Oil 5W30 PFE est&aacute; recomendado para muchos motores modernos, en especial los turbo di&eacute;sel common rail, y los motores gasolina de altas prestaciones que requieran una clasificaci&oacute;n C2.</p>\r\n<p>Para los &uacute;ltimos motores di&eacute;sel con filtro de part&iacute;culas, puede utilizar este 5W30. Consulte su manual de usuario. Este aceite tambi&eacute;n es compatible con motores anteriores gasolina y di&eacute;sel.</p>\r\n<p><strong>Certificaciones</strong></p>\r\n<ul>\r\n<li>ACEA C2</li>\r\n<li>API SN</li>\r\n</ul>', '', '', '', '', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(38, , 'VALVOLINE SYNPOWER XL-III C3 5W30 5L', 'valvoline', '', 'Aceite sintético', '5', '5w30', 'Lubricante especialmente fabricado para motores Volkswagen Euro IV y V equipados con tecnología DPF (filtro de partículas diésel). El producto sustituye a prácticamente todas las especificaciones VW y es válido para motores con sistema WIV, para largos intervalos de cambio (Long-Life) de hasta 30.000 kilómetros o 2 años de mantenimiento.', 31.39, 0, '<p><strong>Beneficios para el cliente</strong></p>\r\n<ul>\r\n<li>Gracias a sus bases sint&eacute;ticas combate las tres principales causas de estr&eacute;s del motor: calor, dep&oacute;sitos y desgaste.</li>\r\n<li>Adecuado&nbsp;para los intervalos de cambio largos de acuerdo a las especificaciones de BMW, MB y VW.</li>\r\n<li>Adecuado para motores EURO V con DPF (filtro de part&iacute;culas di&eacute;sel)</li>\r\n<li>Reduce las emisiones y mejora la eficiencia del combustible en relaci&oacute;n a otros aceites de similares caracter&iacute;sticas.</li>\r\n<li>Alarga la vida &uacute;til del motor y la del filtro de part&iacute;culas di&eacute;sel.</li>\r\n</ul>\r\n<p><strong>Niveles de rendimiento&nbsp;</strong>del&nbsp;<strong>aceite:<br /></strong></p>\r\n<ul>\r\n<li>\r\n<p>ACEA C3</p>\r\n</li>\r\n<li>Cumple con todos los requerimientos de protecci&oacute;n del motor de la ACEA C2</li>\r\n<li>Adecuado para uso en motores donde se recomienda ACEA A3/B4</li>\r\n<li>BMW LL-04</li>\r\n<li>MB-Approval 229.51</li>\r\n<li>Porche C30</li>\r\n<li>Approved under VW Standard 50400/507</li>\r\n</ul>', '', '8710941021867', '', '', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(39, , 'Total Quartz 9000 Energy 5W40 5L', 'total', '', 'Aceite sintético', '5', '5w40', 'Aceite de altas prestaciones con tecnología 100% sintética. Válido para motores gasolina y diésel en coches turismo. Proporciona una excepcional estabilidad térmica y gran resistencia a la oxidación. Óptimo para vehículos equipados con turbo, inyección directa o multiválvulas. También para coches con catalizador.', 19.99, 0, '<h3><strong>Aplicaciones</strong></h3>\r\n<p>QUARTZ 9000 5W-40 ha sido desarrollado para todos los motores de gasolina y diesel. Este lubricante se adapta perfectamente a motorizaciones con turbocompresores, multiv&aacute;lvulas e inyecci&oacute;n directa.<br /><br />QUARTZ 9000 5W-40 es apto para las condiciones de uso las m&aacute;s dif&iacute;ciles (autopista, circulaci&oacute;n urbana intensa&hellip;), en cualquier &eacute;poca del a&ntilde;o. Este producto es perfectamente apto para los motores equipados con catalizadores y compatible con cualquier motor que use carburante sin plomo o gas licuado de petr&oacute;leo (GLP).<br /><br /></p>\r\n<h3><strong>Beneficios para el cliente</strong></h3>\r\n<ul>\r\n<li>Protecci&oacute;n y limpieza: este aceite ofrece una excelente protecci&oacute;n contra el desgaste y el enmugrecimiento gracias a su r&aacute;pida lubricaci&oacute;n desde el arranque y a su aditivaci&oacute;n detergente y dispersante.</li>\r\n<li>Protecci&oacute;n de las motorizaciones: QUARTZ 9000 5W-40 protege las piezas mec&aacute;nicas y preserva la potencia entera la potencia del motor. Contribuyendo as&iacute; a evitar su envejecimiento y en conservar su potencia.</li>\r\n<li>Arranques en fr&iacute;os facilitados: la fluidez a baja temperatura de este lubricante facilita los arranques en frio, y ofrece igualmente una buena resistencia a temperaturas m&aacute;s elevadas.</li>\r\n<li>Intervalos de cambio: la resistencia frente a la oxidaci&oacute;n de este lubricante permite cumplir con los intervalos de cambio alargados.</li>\r\n</ul>\r\n<h3><strong><br />Especificaciones</strong></h3>\r\n<ul>\r\n<li>ACEA A3/B4</li>\r\n<li>API SN/CF</li>\r\n<li>VW 502.00/505.00</li>\r\n<li>MB-Approval 229.5 (retroaplicable 229.3)</li>\r\n<li>PORSCHE A 40</li>\r\n<li>BMW LL-01</li>\r\n</ul>', '', '3425901019277', 'Ficha Técnica', 'total/total-quartz-9000-5w40-t5w40/Ficha Tecnica Total_Quartz_9000_Energy_5W40', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(40, , 'Total Quartz 7000 Energy 10W40 5L', 'total', '', 'Aceite semi-sintético', '5', '10w40', 'Aceite sintético de alta tecnología con altas prestaciones. Está especialmente optimizado para funcionar en motores diésel y gasolina. La tecnología de Total Quartz proporciona una excelente resistencia a la oxidación y disminuye el consumo de carburante en el vehículo. Proporciona además una lubricación rápida de los órganos del motor en la fase de arranque, mejorando así la vida útil del motor.', 18.99, 0, '<h3><strong>Aplicaciones</strong></h3>\r\n<p>QUARTZ 7000 10W-40 ha sido desarrollado para todos los motores de gasolina y diesel* de veh&iacute;culos de turismo y utilitarios. Este lubricante est&aacute; particularmente adaptado a los motores con turbocompresor y multiv&aacute;lvulas. QUARTZ 7000 10W-40 es perfectamente adaptado para una conducci&oacute;n normal por carretera (poca ciudad). Este lubricante est&aacute; adaptado para los motores equipados con tubos catal&iacute;ticos. Es apto, por otra parte, a cualquier motor que utiliza carburante sin plomo, GPL o bio-diesel.</p>\r\n<h3><strong>Beneficios para el cliente</strong></h3>\r\n<ul>\r\n<li>Protecci&oacute;n del motor: la naturaleza de las bases utilizadas, aliada a una selecci&oacute;n de aditivos especialmente puestos a puntos para este producto, confiere a este aceite excelentes propiedades de protecci&oacute;n del motor contra la oxidaci&oacute;n.</li>\r\n</ul>\r\n<ul>\r\n<li>Protecci&oacute;n de las pizas m&aacute;s sensibles: protecci&oacute;n con el tiempo de las piezas las m&aacute;s sensibles del motor contra el desgaste (desgaste de la distribuci&oacute;n, desgaste segmento, pist&oacute;b, camisa).</li>\r\n</ul>\r\n<ul>\r\n<li>Limpieza: este aceite ofrece una buena limpieza del motor llevando las part&iacute;culas y el polvo hacia el filtro de aceite gracias a eficaces propiedades de dispersancia. TOTAL QUARTZ 7000 10W-40 es una referencia ineludible e universal en termino de aplicaci&oacute;n y compatibilidad con los motores.</li>\r\n</ul>\r\n<h3><strong><br />Especificaciones</strong></h3>\r\n<ul>\r\n<li>ACEA A3/B4</li>\r\n<li>API SL/CF</li>\r\n<li>PSA PEUGEOT CITRO&Euml;N B71 2294 &amp; B71 2300</li>\r\n<li>VW 501.01/505.00</li>\r\n<li>MB-Approval 229.1</li>\r\n</ul>', '', '8414794047943', 'Ficha Técnica', 'total/total-quartz-7000-10w40-t10w40/Ficha Tecnica Total_Quartz_7000_Energy_10W40', '', '');
INSERT INTO `aceites_tabla_5` (`id`, `imagen`, `nombre_aceite`, `marca`, `referencia`, `tipo_aceite`, `capacidad`, `viscosidad`, `descripcion`, `precio`, `cantidad`, `informacion`, `especificaciones`, `ean`, `nombre_ficha_tecnica`, `ficha_tecnica`, `nombre_ficha_tecnica2`, `ficha_tecnica2`) VALUES
(41, , 'Repsol Elite TDI 15W40 5L', 'repsol', '', 'Aceite mineral', '5', '15w40', 'Lubricante multigrado, fabricado en base mineral y desarrollado especialmente para motores diésel de inyección directa. Es perfectamente válido también para los motores alimentados en inyección indirecta. Evita la formación de depósitos en el turbocompresor, ayuda en la fase de arranque en frío. Garrafa de 5 litros.', 22.99, 0, '<h3><strong>Cualidades como lubricante: &nbsp;</strong></h3>\r\n<ul>\r\n<li>\r\n<p>Adecuado para todo tipo de motores diesel ligeros, tanto inyecci&oacute;n directa como inyecci&oacute;n indirecta, excepto para los motores TDI del grupo SEAT-AUDI-VW-SKODA que empleen inyector bomba unitario.</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p>Alto poder detergente que permite neutralizar los &aacute;cidos producidos en la combusti&oacute;n, incluso cuando se emplean combustibles con un mayor contenido en azufre.</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p>Muy estable frente a la evaporaci&oacute;n. Mantiene la presi&oacute;n adecuada a cualquier temperatura y en todas las condiciones de trabajo, con un m&iacute;nimo consumo de lubricante</p>\r\n</li>\r\n</ul>\r\n<h4><strong>Nivel de calidad&nbsp;del aceite:</strong></h4>\r\n<ul>\r\n<li>\r\n<p>ACEA A3/B3, A3/B4</p>\r\n</li>\r\n<li>\r\n<p>MB 229.1</p>\r\n</li>\r\n<li>\r\n<p>API SL/CF</p>\r\n</li>\r\n<li>VW 501.01/505.00</li>\r\n</ul>', '', '8410921540950', 'Ficha Técnica', 'repsol/repsol-elite-tdi-15w40-r15w40/Ficha Tecnica Repsol RP_ELITE_TDI_15W40_tcm13-55319', '', '');
